import React from 'react';
import Table from './Table';

const MyComponent = () => {
  const data = [
    { column1: 'Value 1', column2: 'Value 2', column3: 'Value 3' },
    { column1: 'Value 4', column2: 'Value 5', column3: 'Value 6' },
    // Add more rows as needed
  ];

  return (
    <div>
      <h1>My Table</h1>
      <Table data={data} />
    </div>
  );
};

export default MyComponent;
